parent.$mc_ctrler.dampingPercent(0.1,0); //移动阻尼，参数为X,Y

//发射[参数：MC名称，param]
/*
params 参数 {
	x:Number(速度X)|{start:Number(开始速度),add:Number(加速度),max:Number(最大速度),hit:Number(攻击到速度)} , 
	y:Number(速度Y)|{start:Number(开始速度),add:Number(加速度),max:Number(最大速度),hit:Number(攻击到速度)} , 
	hold:int(持续帧数) ,
	hits:int(攻击次数)
}
*/
parent.$mc_ctrler.fire("tzatm",{x:12,y:12,hold:2,hits:1});

//发射[参数：MC名称，param]
/*
params 参数 {
	x:Number(速度X)|{start:Number(开始速度),add:Number(加速度),max:Number(最大速度),hit:Number(攻击到速度)} , 
